import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemSecondaryAction from '@material-ui/core/ListItemSecondaryAction';
import ListItemText from '@material-ui/core/ListItemText';
import Checkbox from '@material-ui/core/Checkbox';

const useStyles = makeStyles((theme) => ({
  root: {
    width: '100%',
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
  },
}));

export default function Todos() {
  const classes = useStyles();
  const [select, setSelect] = useState('serial');
  const [information, setInformation] = useState(null);
  const user = JSON.parse(localStorage.getItem('user'));
  useEffect(() => {
    fetch(`https://jsonplaceholder.typicode.com/todos/?userId=${user.id}`)
      .then(response => response.json()
        .then((data) => {

          setInformation(data)
        }))
      .catch(() => { })

  }, [user.id])


  const serial = () => {

    let data = information;
    data.sort((a, b) => {
      if (a.id < b.id)
        return -1
      else
        return 1;
    }
    )
    setInformation(data);


  }
  const alphaBeit = () => {
    let data = information;
    data.sort((a, b) => {
      if (a.title < b.title)
        return -1
      else
        return 1;
    }
    );
    setInformation(data);

  }

  const complete = () => {
    let notChecked = []
    let checked = [];
    for (let i = 0; i < information.length; ++i) {
      if (information[i].completed) {
        checked.push(information[i]);
      } else {
        notChecked.push(information[i])
      }

    }
    let data = [...checked, ...notChecked];
    setInformation(data)

  }

  const random = () => {
    let data = information;
    for (let i = 0; i < data.length; ++i) {
      let randomNum = Math.floor(Math.random() * data.length);
      let num = data[i];
      data[i] = data[randomNum];
      data[randomNum] = num;
    }
    setInformation(data)

  }




  const handleOnChange = (e) => {
    let value = e.target.value;
    setSelect(value);
    switch (value) {
      case "alphaBeit":
        alphaBeit();
        break;
      case "complete":
        complete();
        break;
      case "random":
        random();
        break;
      default:
        serial();
        break;
    }
  }


  return (
    <List dense className={classes.root}>
      {information && (information.map((value) => {
        const labelId = `checkbox-list-secondary-label-${value}`;
        return (
          <ListItem key={value} button>
            <ListItemIcon>
              <AttachmentOutlinedIcon/>
            </ListItemIcon>
            <ListItemText id={labelId} primary={value.title} />
            <ListItemSecondaryAction>
              {/* <Checkbox
                edge="end"
                checked={value.completed}
                inputProps={{ 'aria-labelledby': labelId }}
              /> */}
              <Checkbox icon={<FavoriteBorder />} checkedIcon={<Favorite />} name="checkedH"  edge="end"
                checked={value.completed}
                inputProps={{ 'aria-labelledby': labelId }}/>
            </ListItemSecondaryAction>
          </ListItem>
        );
      }))}
    </List>
  );
}
